    b3list[i] = gsl_spline_eval( spline, a/(1.0-2.0*eta), acc );
    gsl_spline_init( spline, alist, b4tab[i], adim );
    gsl_interp_accel_reset( acc );
    b4list[i] = gsl_spline_eval( spline, a/(1.0-2.0*eta), acc );
