  nqcmin = chiAminCoeffs.a3S;
  coeffs->a3S = cmax*nqcmax + cmed*nqcmed + cmin*nqcmin;
  //printf( "a3max = %f, a3med = %f, a3min = %f, a3 = %f\n",
  //  nqcmax, nqcmed, nqcmin, coeffs->a3S );
  nqcmax = chiAmaxCoeffs.a4;
